import React from "react";
import Home from "./Home";
import About from "./About";
import Portfolio from "./Portfolio";
import Experience from "./experience";
import Contact from "./Contact";
import "./styles.css";

export default function App() {
  return (
    <>
      <Home />
      <About />
      <Portfolio />
      <Experience />
      <Contact />
    </>
  );
}
